async function main() {
  try {
    for (const site of sitesData) {
      await prisma.site.create({
        data: {
          url: site.url,
          title: site.title,
          favicon: site.favicon,
          summarize: site.summarize,
          createdAt: site.createdAt,
          tags: {
            connectOrCreate: site.tags.map((tag) => ({
              where: { name: tag },
              create: { name: tag }
            }))
          }
        }
      });
      console.log(`Inserted: ${site.title}`);
    }
  } catch (e) {
    console.error(e);
  } finally {
    await prisma.$disconnect();
  }
}

main();
